import React from 'react'
import { AppBar, Typography } from '@material-ui/core'
import { Link, Router } from 'react-router-dom'



function Header() {
    return (

        <AppBar position="static">
            <Link to="/">Home</Link>
        </AppBar>

    )

}

export default Header
